    constructor(props){
        super(props);
        let listData = axios.get("http://localhost:8080/").then(response => {
            console.log(response);
            console.log(response.data.rows[0]);
        }).catch(response => {
            console.log(response);
        })
    }

    handleClick = () => {
        console.log("click!")
    }

    render() {
        return (
            <div>
                <BlogList onClick={this.handleClick}/>
            </div>
        )
    }
}

export default Blog;
